import {
    fetchDogs,
    fetchTemperaments,
    filterByTemperaments
} from "../redux/action/actions"
import { useEffect } from "react";


const useAllDogs = (() => {
    dispatch(fetchDogs());
    dispatch(fetchTemperaments());
    dispatch(filterByTemperaments());
  }, [dispatch]);

export default useAllDogs
